def gcd(a, b):
	if b == 0:
		return a
	return gcd(b, a % b)

def solve(s):

	mx = -1
	cnt = 1

	for i in range(len(s) - 1):
		if s[i] == s[i+1]:
			cnt += 1
		else:
			mx = max(mx, cnt)
			cnt = 1
	return max(mx, cnt)

s1 = input()
s2 = input()


mx1 = solve(s1) / len(s1)
mx2 = solve(s2) / len(s2)

if mx1 < mx2:
	print(2)
else:
	print(1 if mx1 > mx2 else '=')
